.
This internal sense of rightness that we all experience so often is not a reliable guide to what is actually going on in the external world. 
.
And when we act like it is, and we stop entertaining the possibility that we could be wrong.. well, you know, that's when we wind up doing things like dumping 200 million gallons of oil into the Gulf of Mexico, or torpedoing the global economy.
.
This is a catastrophe. This attachment to our own rightness keeps us from preventing mistakes when we absolutely need to, and causes us to treat each other terribly." -Katheryn Schultz
